import styled from "styled-components";

export const LoginWrapper = styled.div`
    height: 100%;
    min-height: 750px;
    text-align: center;
    font-size: 14px;
    background-color: #f1f1f1;
`;

export const LoginBox = styled.div`
    width: 400px;
    height: 200px;
    margin: 40px auto;
    background: red;
`;
